function keyCode(input) {

  var keypad = {
    '1': '-1,1',
    '2': '0,1',
    '3': '1,1',
    '4': '-1,0',
    '5': '0,0',
    '6': '1,0',
    '7': '-1,-1',
    '8': '0,-1',
    '9': '1,-1'
  }

  var position = [0, 0];
  var instruction;
  var code = [];

  for (var line of input) {
    instruction = line.split('');

    for (var step of instruction) {
      switch (step) {
        case 'R':
          if (position[0] === 1) {
            break;
          } else {
            position[0] += 1;
            break;
          }
        case 'L':
          if (position[0] === -1) {
            break;
          } else {
            position[0] -= 1;
            break;
          }
        case 'U':
          if (position[1] === 1) {
            break;
          } else {
            position[1] += 1;
            break;
           }
        case 'D':
          if (position[1] === -1) {
            break;
          } else {
            position[1] -= 1;
            break;
          }
      }
    }

    var stringPosition = position.join();

    for (var value in keypad) {

      if (keypad[value] === stringPosition) {
        code.push(value)
      }
    }
  }

  console.log(code);
}

var input = [
  '',
  '',
  '',
  '',
  ''
]

keyCode(input);

